import React, { useState } from 'react'; // Import useState
import './Form.css';
import cutm from "./image/cutm.png";
import { Link, useNavigate } from 'react-router-dom'; // Import useHistory

function Form() {
  const history = useNavigate(); // Initialize useHistory

  const handleSubmit = () => {
    if ('') {
      // Simulate submission logic
      history.push('/Status'); // Corrected the usage of history.push
      console.log('Submitted successfully with username:',);
    } else {
      alert('Please fill in all requirements.');
    }
  };

  return (
    <div className='main'>
      <div className='tittle'>
        <img src={cutm} alt="cutm" className='cutm'/>
        <h1><i><u>Online</u></i></h1>
        <h2><i><u>No Due</u></i></h2>
      </div>
      <div className='sub2'>
        <div className='menu2'>
          <h3><u>Menu</u></h3>
          <div className='button'>
            <Link to='/Profile'>
              <button>Profile</button>
            </Link>
            <Link to='/Approve'>
              <button>Approve</button>
            </Link>
            <Link to='/Signup'>
              <button>Logout</button>
            </Link>
          </div>
        </div>
        <div className='form'>
          <h3><u>Apply No Due</u></h3>
          {/* ... (other form inputs) */}
          <div className='login_button'>
            <button onClick={handleSubmit}>Submit</button>
          </div>
        </div>
      </div>
    </div> 
  );
}

export default Form;
